const smileyStyle = {
    margin: 20,
    padding: 20,
	fontSize: 100  //oh my god what have I done?!
}
function SmileIcon(a,b){
	if ((a+b)>=0) 
	{
	return (
	<p>
<span style={smileyStyle}>&#128526; hey! {a+b}</span>
	</p>
	)
	}
}

function PageStructure() {
	useEffect(()=>{
		setInterval(()=>{alert('ciao')},5000)
	},[])
	return ( 
		<div>
			<p>hello there! again :)....</p>
			{SmileIcon(1,1)} 
		</div>
	)
}

export default function Index() {
	return (
	<Layout content= <PageStructure/> />

)
}
